export const getCities = () => {
  return [...new Set(locationData.map(loc => loc.city))];
};

export const getDistricts = (city) => {
  return [...new Set(locationData.filter(loc => loc.city === city && loc.ku).map(loc => loc.ku))];
};

export const getDongs = (city, district) => {
  return [...new Set(locationData.filter(loc => loc.city === city && loc.ku === district && loc.dong).map(loc => loc.dong))];
};

export const getLocationInfo = (city, district = "", dong = "") => {
  return locationData.find(loc => loc.city === city && loc.ku === district && loc.dong === dong);
};